import "./styles.css";
import data from "./demo-data.json";
import React, { useState } from "react";

export default function App() {
  const [input, setInput] = useState('')

  const Wrapper = ({ path, property, clickable, children }: { path: string, property: string, clickable?: boolean, children: React.ReactNode }) => {
    return <div className="indented">
      {path}
      <Key property={property} clickable={clickable} />
      {children}
    </div>
  }

  const Key = ({ property, clickable }: { property: string, clickable?: boolean }) => {
    return <span className={clickable ? "clickable-property key" : "key"}>{`${property}: `}</span>;
  };

  const iterateObject = (object: any): any => {
    return Object.keys(object).map((key) => {
      switch (typeof object[key]) {
        case "string":
          return (
            <Wrapper key={key} path={key} property={key}>
              {`"${object[key]}"`}
            </Wrapper>)
        case "boolean":
          return (
            <Wrapper key={key} path={key} property={key}>
              {object[key].toString()}
            </Wrapper>)

        default:
          if (Array.isArray(object[key])) {
            return (
              <Wrapper key={key} path={key} property={key}>
                {object[key].map((elem: any) => <>&#123;{iterateObject(elem)}&#125;</>)}

              </Wrapper>
            )
          } else {
            return (
              <Wrapper key={key} path={key} property={key}>
                &#123;
                {iterateObject(object[key])}
                &#125;
              </Wrapper>
            )

          }
      }
    });
  };

  return (
    <div className="App">
      <div>
        <label htmlFor="property-input">Property</label>
        <input type="text" id="property-input" />
      </div>

      <div>
        Response
        <div>{iterateObject(data)}</div>
      </div>
    </div>
  );
}
